import React from 'react';

function Profile() {

    return(
        <>
        <div id='profileArea'>

            <h1>Profile</h1>

            <b>First Name: </b>
            <br/>
            <b>Last Name: </b>

            <br/><br/><br/>

            <h1>Past Orders</h1>

        </div>
        </>
    )
}

export default Profile;
